  `sex` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别（0：保密；1：男；2：女）',
  `birthday` date DEFAULT NULL COMMENT '出生日期',
  `score` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '红人圈分值',
