/*Table structure for table `goods` */

DROP TABLE IF EXISTS `goods`;

CREATE TABLE `goods` (
  `goods_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `cat_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分类id',
  `title` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '产品标题',
  `alias` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '产品标题别名（应用于web端）',
  `indexpic` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '标题图片',
  `goods_sn` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '商品唯一ID',
  `pictures` text CHARACTER SET utf8 NOT NULL COMMENT '图片地址',
  `price` decimal(9,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '价格',
  `memprice` decimal(9,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '红人圈',
  `kucun` int(11) unsigned DEFAULT '0' COMMENT '库存数量',
  `shouchu` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '售出多少件',
  `attr` text COLLATE utf8mb4_unicode_ci COMMENT '规格属性',
  `intro` text CHARACTER SET utf8 NOT NULL COMMENT '商品详细信息',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0禁用；1为正常',
  `sj` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0为下架；1为上架',
  `up_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品上架时间',
  `down_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '品商下架时间',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '商品添加时间',
  `update_time` int(11) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`goods_id`),
  KEY `goods_id` (`goods_id`),
  KEY `title` (`title`),
  KEY `sj` (`sj`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

