/*Table structure for table `goods_cat` */

DROP TABLE IF EXISTS `goods_cat`;

CREATE TABLE `goods_cat` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品分类表主键ID',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '分类名称',
  `desc` varchar(255) DEFAULT '' COMMENT '分类描述',
  `cat_path` varchar(100) DEFAULT ',' COMMENT '分类路径',
  `pid` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '父分类ID',
  `disabled` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '失效(有效;0;失效:1)',
  `icon` varchar(100) DEFAULT '' COMMENT '分类图标',
  `sex` tinyint(1) NOT NULL DEFAULT '0' COMMENT '性别（0：通用；1：男：2：女）',
  `is_hot` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否热门（0：不是；1：是）',
  `sort` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '排序（默认0,值小排序靠前）',
  `child_count` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '子分类数量',
  `goods_count` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '分类下商品数量',
  `type_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '类型ID(关联商品类型表)',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
