/*Table structure for table `goods_products` */

DROP TABLE IF EXISTS `goods_products`;

CREATE TABLE `goods_products` (
  `product_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `product_sn` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '商品唯一编码',
