/*Table structure for table `order` */

DROP TABLE IF EXISTS `order`;

CREATE TABLE `order` (
  `order_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(15) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '下单用户ID',
  `order_address` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '下单地址',
  `order_status` tinyint(1) unsigned zerofill NOT NULL DEFAULT '0' COMMENT '订单状态（0：待兑换；1：待发货；2：待收货；3：已完成；4：已取消）',
  `goods_products` text CHARACTER SET utf8 NOT NULL COMMENT '商品序列化存储',
  `sure_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '确认日期',
  `fahuo_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发货时间',
  `wuliu_sn` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '物流单号',
  `order_desc` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '订单备注',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '订单配送方式（0：物流快递，1：上门自提）',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `UNIQUE` (`order_sn`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

