/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '粉丝表ID',
  `username` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '用户名',
  `openid` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '小程序唯一标识符',
  `mobile` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `password` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '密码',
  `token` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'token',
  `token_overtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'token过期时间',
  `score` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '红人圈分值',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态（0：冻结；1：正常）',
  `avatar` varchar(255) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '头像',
  `sex` tinyint(1) NOT NULL DEFAULT '0' COMMENT '性别（0：保密；1：男；2：女）',
  `login_count` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '登录次数',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `source` tinyint(1) NOT NULL DEFAULT '0' COMMENT '来源（0：web；1：wechat；2：android；3：ios；4：pad）',
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_mobile_unique` (`mobile`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='粉丝表';

