/*Table structure for table `users_invite` */

DROP TABLE IF EXISTS `users_invite`;

CREATE TABLE `users_invite` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '邀请者ID',
  `invited_openid` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '被邀请openid',
  `create_time` datetime NOT NULL COMMENT '创建时间',
