/*Table structure for table `users_sign` */

DROP TABLE IF EXISTS `users_sign`;

CREATE TABLE `users_sign` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '粉丝ID',
  `sign_count` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '连续签到次数',
